import React from "react";

export default function TextBoxStyle1({placholder="sssssss"}){
    return(
        <div>
        <input type="text" placeholder={placholder} class="border border-blue-500 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-blue-500 font-cairo placeholder-gray-500 m-5" />
        </div>
    );
}
